// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navigation from './components/Navigation';
import ChatBot from './components/ChatBot';
import './styles.css';

function App() {
  return (
      <Router>
          <main className="main-content">
            <Routes>
              <Route path="/chat" element={<div className="chat-container"><ChatBot/></div>}/>
              {/* Add other routes based on your navigation structure */}
              <Route path="/" element={<div className="home-content">Home Page Content</div>}/>
            </Routes>
          </main>

          <footer className="site-footer">
            <p>&copy; {new Date().getFullYear()} Your Website</p>
          </footer>
      </Router>
  );
}

export default App;
